import React, { Component, Fragment } from 'react';
import DonutChart from 'react-donut-chart';
import {
  ToggleBar,
  ToggleItem,
  BodyWrapper,
  FilterWrapper,
  FilterButton,
  SectionWrapper,
  GroupWrapper,
  CategoryTitle,
  ChartWrapper,
  VisualWrapper,
  LedgerItem,
} from './BodySection.styled.js';

class BodySection extends Component {
  constructor(props){
    super(props);
    this.state={
      currentView: 'snapshot',
      showPremiumRange: true,
      showMarkets: false,
      showIndustries: true,
      showProducts: false,
    };

    this.setCurrentView = this.setCurrentView.bind(this);
    this.premiumRangeOnClick = this.premiumRangeOnClick.bind(this);
    this.marketsOnClick = this.marketsOnClick.bind(this);
    this.industriesOnClick = this.industriesOnClick.bind(this);
    this.productsOnClick = this.productsOnClick.bind(this);
    this.renderSection = this.renderSection.bind(this);
  }

  setCurrentView(view) {
    this.setState({currentView: view})
  }

  premiumRangeOnClick() {
    const previousState = this.state.showPremiumRange;
    this.setState({ showPremiumRange: !previousState });
  }

  marketsOnClick() {
    const previousState = this.state.showMarkets;
    this.setState({ showMarkets: !previousState });
  }

  industriesOnClick() {
    const previousState = this.state.showIndustries;
    this.setState({ showIndustries: !previousState });
  }

  productsOnClick() {
    const previousState = this.state.showProducts;
    this.setState({ showProducts: !previousState });
  }

  renderSection(category) {
    const data = [{
        label: '',
        value: 25
    },
    {
        label: '',
        value: 75,
    }];

    return(
      <SectionWrapper>
        <GroupWrapper>
          <CategoryTitle>{category}</CategoryTitle>
          <ChartWrapper>
            <div>
              <LedgerItem>One</LedgerItem>
              <LedgerItem>Two</LedgerItem>
              <LedgerItem>Three</LedgerItem>
              <LedgerItem>Four</LedgerItem>
            </div>
            <VisualWrapper>
              <DonutChart
                data={data}
                width={150}
                colors={['#013d40', '#006567', '#008f91', '#00afb1', '#02c7b0', '#607d8b', '#30a200', '#00ce5f', '#00e833', '#01ff39#' ]}
                legend={false}
              />
            </VisualWrapper>
          </ChartWrapper>
        </GroupWrapper>
        <GroupWrapper>
          <CategoryTitle>{category}</CategoryTitle>
          <ChartWrapper>
            <div>
              <LedgerItem>One</LedgerItem>
              <LedgerItem>Two</LedgerItem>
              <LedgerItem>Three</LedgerItem>
              <LedgerItem>Four</LedgerItem>
            </div>
            <VisualWrapper>
              <DonutChart
                data={data}
                width={150}
                colors={['#013d40', '#006567', '#008f91', '#00afb1', '#02c7b0', '#607d8b', '#30a200', '#00ce5f', '#00e833', '#01ff39#' ]}
                legend={false}
              />
            </VisualWrapper>
          </ChartWrapper>
        </GroupWrapper>
      </SectionWrapper>
    )
  }

  render() {
    return (
      <Fragment>
        <ToggleBar>
          <ToggleItem
            onClick={() => this.setCurrentView('snapshot')}
            selected={this.state.currentView === 'snapshot'}
          >SNAPSHOT</ToggleItem>
          <ToggleItem
            onClick={() => this.setCurrentView('trends')}
            selected={this.state.currentView === 'trends'}
          >TRENDS</ToggleItem>
        </ToggleBar>
        {this.state.currentView === 'trends' ? <div>Sorry Come Back Soon!</div> :
          <BodyWrapper>
            <FilterWrapper>
              <FilterButton
              selected={this.state.showPremiumRange}
              onClick={this.premiumRangeOnClick}
              >Premium Range</FilterButton>
              <FilterButton
                selected={this.state.showMarkets}
                onClick={this.marketsOnClick}
              >Markets</FilterButton>
              <FilterButton
                selected={this.state.showIndustries}
                onClick={this.industriesOnClick}
              >Induestries</FilterButton>
              <FilterButton
                selected={this.state.showProducts}
                onClick={this.productsOnClick}
              >Products</FilterButton>
            </FilterWrapper>
            {this.state.showPremiumRange ? this.renderSection('Premium Range') : null}
            {this.state.showMarkets ? this.renderSection('Markets') : null}
            {this.state.showIndustries ? this.renderSection('Industries') : null}
            {this.state.showProducts ? this.renderSection('Products') : null}
          </BodyWrapper>
        }
      </Fragment>
    );
  }
}

export default BodySection;
